func threeSum(nums []int) [][]int {
	if len(nums) < 3 {
		return [][]int{}
	}
	ans := make([][]int, 0)
	ansMap := make(map[string]bool, 0)
	for i := 0; i < len(nums)-2; i++ {
		vali := nums[i]
		target := 0 - vali
		hashMap := make(map[int]int, 0)
		for j := i + 1; j < len(nums); j++ {
			valj := nums[j]
			if _, ok := hashMap[target-valj]; !ok {
				hashMap[valj] = j
			} else {
				tmp := []int{vali, valj, target - valj}
				sort.Slice(tmp, func(m, n int) bool {
					return tmp[m] < tmp[n]
				})
				key := fmt.Sprintf("%d_%d_%d", tmp[0], tmp[1], tmp[2])
				if _, exist := ansMap[key]; !exist {
					ans = append(ans, tmp)
					ansMap[key] = true
				}
			}
		}
	}
	return ans
}

// 先排序，因不关注下标，故原数组排序，排序的作用是去掉内层的小排序
// 使用hash表去重
func threeSumV3(nums []int) [][]int {
	//升序排
	sort.Slice(nums, func(i, j int) bool {
		return nums[i] < nums[j]
	})
	ans := make([][]int, 0)
	ansMap := make(map[string]bool, 0) //去重
	for i := 0; i < len(nums)-2; i++ {
		target := 0 - nums[i]
		hashMap := make(map[int]int, 0)
		for j := i + 1; j < len(nums); j++ {
			if _, ok := hashMap[target-nums[j]]; !ok {
				hashMap[nums[j]] = j
			} else {
				key := fmt.Sprintf("%d_%d_%d", nums[i], target-nums[j], nums[j])
				if _, exist := ansMap[key]; !exist {
					ansMap[key] = true
					ans = append(ans, []int{nums[i], target - nums[j], nums[j]})
				}
			}
		}
	}
	return ans
}

// 先排序
// 双指针寻找匹配对
// 循环执行过程中，因数组本身有序，可以直接判断跟上一次元素是否相同，若相同，则跳过，因为可能重复
func threeSumV4(nums []int) [][]int {
	ans := make([][]int, 0)
	sort.Slice(nums, func(i, j int) bool {
		return nums[i] < nums[j]
	})
	for i := 0; i < len(nums)-2; i++ {
		if i > 0 && nums[i] == nums[i-1] {
			continue
		}
		target := 0 - nums[i]
		j, k := i+1, len(nums)-1
		for j < k {
			sum := nums[j] + nums[k]
			if sum == target {
				ans = append(ans, []int{nums[i], nums[j], nums[k]})
				j++
				k--
			} else if sum > target {
				k--
			} else {
				j++
			}
			//跳过重复元素
			for j < k && nums[j] == nums[j-1] {
				j++
			}
			for j < k && nums[k] == nums[k+1] {
				k--
			}
		}
	}
	return ans
}
